from snownlp import SnowNLP
import xlrd
import re


def comment_sentiment():
    workbook = xlrd.open_workbook(r'data/comments.xlsx')
    sheet1 = workbook.sheet_by_index(0)
    res_dict = {}
    pattern = re.compile(r'(https?|ftp|file)://[-A-Za-z0-9+&@#/%?=~_|!:,.;]+[-A-Za-z0-9+&@#/%=~_|]')
    # pattern_mark = re.compile(r'[\s+\.\!\/_,$%^*(+\"\')]+|[+——()?【】“”！，。？、~@#￥%……&*（）☆《》\d+年月日·：↓]+')
    for i in range(sheet1.nrows):
        if not res_dict.keys().__contains__(sheet1.row_values(i)[3][6:]):
            res_dict[sheet1.row_values(i)[3][6:]] = {}
            res_dict[sheet1.row_values(i)[3][6:]]['pos'] = 0
            res_dict[sheet1.row_values(i)[3][6:]]['neg'] = 0
            res_dict[sheet1.row_values(i)[3][6:]]['mid'] = 0
        string = sheet1.row_values(i)[4].replace('#阴阳师手游[超话]#', '').replace('\n', '').replace('#阴阳师手游#', '').strip()
        string = re.sub(pattern, '', string)
        # string = re.sub(pattern_mark, '', string)
        senti = sentence_sentiment(string)
        if senti > 0.65:
            res_dict[sheet1.row_values(i)[3][6:]]['pos'] += (sheet1.row_values(i)[2] + 1) * (senti - 0.5)
        elif senti < 0.35:
            res_dict[sheet1.row_values(i)[3][6:]]['neg'] += (sheet1.row_values(i)[2] + 1) * (0.5 - senti)
        else:
            if senti < 0.5:
                res_dict[sheet1.row_values(i)[3][6:]]['mid'] += (sheet1.row_values(i)[2] + 1) * (0.5 - senti)
            else:
                res_dict[sheet1.row_values(i)[3][6:]]['mid'] += (sheet1.row_values(i)[2] + 1) * (senti - 0.5)
    return res_dict


def sentiment(analyze_list):
    senti = [SnowNLP(i).sentiments for i in analyze_list]
    return senti


def sentence_sentiment(sentence):
    senti = SnowNLP(sentence).sentiments
    return senti


